        name: "",
        email: "",
        password: ""
    });

  const handleSubmit = () => {};
  return (
    <form onSubmit={handleSubmit}>
      <Box
        marginLeft={'auto'}
        marginRight={'auto'}
        width={'300px'}
        display="flex"
        flexDirection="column"
        justifyContent={'center'}
        alignItems={'center'}
      >
        <Typography variant="h3">Signup</Typography>
        <TextField value={inputs.name} margin="normal" variant='outlined' placeholder='Name' />
        <TextField ty value={inputs.email} margin="normal" variant='outlined' placeholder='Email'/>
        <TextField  value={inputs.password} margin="normal" variant='outlined' placeholder='Password' />
        <Button type="submit" variant='contained'>Signup</Button>
      </Box>
    </form>
  );
};

export default Signup;
